import {createAction} from '@reduxjs/toolkit'
import {AuthTypes} from "../reducers/authReducer"


export const fetchTokenBegin = createAction<AuthTypes>('token/beginFetch');
export const fetchTokenSuccess = createAction<AuthTypes>('token/fetchSuccess');
export const fetchTokenFailure = createAction<AuthTypes>('token/fetchFailure');
